def robustness_check_for_nn(filename, modelType, outputName, sample_input_vec, delta):
    network = Marabou.read_tf(filename=filename, modelType=modelType, outputName=outputName)

    inputVars = list(range(784))
    outputVars = list(range(784, 794))

    # inputVars = network.inputVars[0][0]
    # outputVars = network.outputVars[0]

    # constraints for input - search for infinity norm of delta
    for i in range(784):
        fixed_lower_bound = max(0, sample_input_vec[i]-abs(delta))
        fixed_upper_bound = min(1, sample_input_vec[i]+abs(delta))

        network.setLowerBound(inputVars[i],fixed_lower_bound)
        network.setUpperBound(inputVars[i],fixed_upper_bound)

    # constraint on output # todo restore
    network.addInequality(vars=[outputVars[RUNNER_UP],outputVars[TRUE_LABEL]], coeffs=[-1, 1], scalar=0)
    network.saveQuery("../../xnor_fashion_sample_index_" + str(TEST_IMAGE_INDEX))
    vals, stats = network.solve("../../run_on_test_index_"+ str(TEST_IMAGE_INDEX) + ".log", verbose=True)

    adversary, nn_output = np.array(list(vals.values())[:784]), np.array(list(vals.values())[784:794])

    return adversary, nn_output



def robustness_check_for_parsed_query(ipq_filename, sample_input_vec, delta):
    ipq = Marabou.load_query(filename=ipq_filename)

    inputVars = list(range(784))
    outputVars = list(range(784, 794))

    for i in range(784):
        fixed_lower_bound = max(0, sample_input_vec[i]-abs(delta))
        fixed_upper_bound = min(1, sample_input_vec[i]+abs(delta))

        ipq.setLowerBound(inputVars[i], fixed_lower_bound)
        ipq.setUpperBound(inputVars[i], fixed_upper_bound)

    # put int OPTIONS: timeoutInSeconds=NUM_OF_HOURS*3600 # todo unmask and put in OPTIONS?
    #options = Marabou.createOptions(numWorkers=5, dnc=True, timeoutInSeconds=NUM_OF_HOURS*3600) # todo added
    #dict_for_original = Marabou.solve_query(ipq=ipq, filename="marabou.log", verbose=True, options=options) # todo delete
    dict_for_original = Marabou.solve_query(ipq=ipq, filename="marabou_no_dnc_merge_on.log", verbose=True)
    adversary, nn_output = list(dict_for_original[0].values())[: 784],  list(dict_for_original[0].values())[784: 794] # todo delete

    return adversary, nn_output


